import Loadable from 'react-loadable';

const LoadingComponent = ({isLoading, error}) => {
  // Handle the loading state
  if (isLoading) {
    return <div />;
  } else if (error) {
    // Handle the error state
    return <div />;
  } else {
    return null;
  }
};
const Home = Loadable({
  loader: () =>
    import('../../layouts/Home'),
  loading: LoadingComponent
});

const Menu = Loadable({
  loader: () =>
    import('../../layouts/Menu'),
  loading: LoadingComponent
});

let Current = {
  Home,
  Menu
};

export default Current;
